import React, { useEffect } from "react";

const BASE_IMAGE_PATH = "https://image.tmdb.org/t/p/w500";

const Movie = (title, imagePath) => {
  useEffect(() => {
    fetch(`${BASE_IMAGE_PATH}/${imagePath}`);
  });

  return <div>movies</div>;
};

export default Movie;
